import React from 'react'

const ShowTips=(props)=>{
  console.log(props.tips)
  let tipsElem = props.tips.map((tip)=>{
    return(
      <div>
        Date: {tip.date}
      </div>
    )
  })
  return(
    <div>
      {tipsElem}
    </div>
  )
}

export default ShowTips
